import React, { useState } from 'react';

const Search = () => {

    const [search, setSearch] = useState()

    return (
        <div>
            <input type="text" placeholder='Введите название' autoComplete='off' value={search} onChange={(e)=>setSearch(e.target.value)}/>
        </div>
    );
};

export default Search;
